void jer_interrupts_array_deinit(int unit)
{
    soc_interrupt_db_t *jer_interrupts;
    soc_interrupt_tree_t *jer_interrupt_tree;
    int inter = 0;
    SOCDNX_INIT_FUNC_DEFS;

    /* this unit not init, no nothing to detach; done. */
    if(NULL == SOC_CONTROL(unit)->interrupts_info) {
        SOC_EXIT;
    }

    jer_interrupts = SOC_CONTROL(unit)->interrupts_info->interrupt_db_info;
    jer_interrupt_tree = SOC_CONTROL(unit)->interrupts_info->interrupt_tree_info;

    for (inter = 0; inter < JER_INT_LAST ; inter++) {
        if (jer_interrupts[inter].statistics_count != NULL) {
            sal_free(jer_interrupts[inter].statistics_count);
            jer_interrupts[inter].statistics_count = NULL;
        }
        if (jer_interrupts[inter].storm_nominal_count != NULL) {
            sal_free(jer_interrupts[inter].storm_nominal_count);
            jer_interrupts[inter].storm_nominal_count = NULL;
        }       
        if (jer_interrupts[inter].storm_detection_occurrences != NULL) {
            sal_free(jer_interrupts[inter].storm_detection_occurrences);
            jer_interrupts[inter].storm_detection_occurrences = NULL;
        }
        if (jer_interrupts[inter].storm_detection_start_time != NULL) {
            sal_free(jer_interrupts[inter].storm_detection_start_time);
            jer_interrupts[inter].storm_detection_start_time = NULL;
        }
    }

    if (jer_interrupts != NULL) {
        sal_free(jer_interrupts);
        SOC_CONTROL(unit)->interrupts_info->interrupt_db_info = NULL;
    }

    if (jer_interrupt_tree != NULL) {
        sal_free(jer_interrupt_tree);
        SOC_CONTROL(unit)->interrupts_info->interrupt_tree_info = NULL;
    }

    if(SOC_CONTROL(unit)->interrupts_info != NULL) {
        sal_free(SOC_CONTROL(unit)->interrupts_info);
        SOC_CONTROL(unit)->interrupts_info = NULL;
    }

exit:
    SOCDNX_FUNC_RETURN_VOID;
}
